$(function(){$("form").on("submit",function(d){d.preventDefault();$(".text-content").add(".image-content").empty();var b=$("#uri").val(),c=$(".submit-btn"),a=$("#container-svg");$.ajax({type:"POST",url:"/",data:{url:b},beforeSend:function(){c.prop("disabled",true);a.fadeIn()}}).done(function(f){var e=f.textContent;var g=f.imgContent;$(e).each(function(h,i){$(".text-content").append("<li>"+i.text+"</li>")});$(g).each(function(h,i){if(i.indexOf("http")!=-1){$(".image-content").append("<li>"+i+"</li>")}})}).fail(function(){}).always(function(){c.prop("disabled",false);a.fadeOut()})});(function(){$("#uri").on("focus",function(){$(this).select()})})()});